--MySQL int auto_increment, double, datetime
--PostgreSQL serial, decimal, date
--Datos de usuario
create table roles(
  id int auto_increment primary key,
  name text not null
);

create table users(
  id int auto_increment primary key,
  name text not null,
  last_name text not null,
  email text not null,
  password varchar(40) not null,
  gender varchar(1) not null,
  rol int not null,
  foreign key (rol) references roles(id)
);

--Campañas
create table campaings(
  id serial primary key,
  created_by int not null,
  name text not null,
  date_start date not null,
  date_end date not null,
  product_id int not null,
  status text not null,
  target text not null,
  description text not null,
  duration int,
  date_created date,
  color text,
  foreign key (created_by) references users(id)
);

create table emails(
  id serial primary key,
  created_by int not null,
  campaing_id int not null,
  date_send date,
  subject text not null,
  content text not null,
  status text,
  date_created date,
  foreign key (created_by) references users(id),
  foreign key (campaing_id) references campaings(id)
);

--Productos
create table products(
  id serial primary key,
  created_by int not null,
  name text not null,
  market text not null,
  model text not null,
  price decimal,
  description text,
  category int,
  quantity int,
  stock int,
  features text,
  status boolean default true,
  img text,
  date_created date,
  foreign key (created_by) references users(id),
  foreign key (category) references categories(id)
);

--Categorias
create table categories(
  id serial primary key,
  name text not null
);

--Perfil del cliente
create table jobs(
  id int auto_increment primary key,
  name text not null,
  salary double
);

create table postcodes(
  id int primary key,
  place text not null,
  city text not null,
  entity text not null
);

create table schools(
  id int auto_increment primary key,
  name text not null
);

create table status_civil(
  id int auto_increment primary key,
  name text not null
);

create table customers(
  id serial primary key,
  name text not null,
  last_name text not null,
  birthdate date,
  gender varchar(1),
  email text not null,
  telephone varchar(10),
  street text,
  number text,
  postcode int,
  place text,
  city text,
  entity text,
  type varchar(1),
  status text,
  job int,
  school int,
  status_civil int,
  sons int,
  date_created date,
  password text,
  foreign key (postcode) references postcodes(id),
  foreign key (job) references jobs(id),
  foreign key (school) references schools(id),
  foreign key (status_civil) references status_civil(id)
);

--Mercados
create table teams(
  id int auto_increment primary key,
  created_by int not null,
  name text,
  description text,
  status text not null,
  date_created date,
  foreign key (created_by) references users(id)
);

create table campaing_team(
  id int auto_increment primary key,
  campaing_id int not null,
  team_id int not null,
  foreign key (campaing_id) references campaings(id),
  foreign key (team_id) references teams(id)
);

create table customer_team(
  id int auto_increment primary key,
  customer_id int not null,
  team_id int not null,
  foreign key (customer_id) references customers(id),
  foreign key (team_id) references teams(id)
);

